import React, {useState, useEffect} from 'react';
import axios from 'axios';


function AxiosTest (props) {
  const [doggoData, setDoggoData] = useState ({data: []});
  const [isLoading, setIsLoading] = useState (true);

  // GET
  useEffect (() => {
    const fetchData = async () => {
      const result = await axios.get (
        'http://dummy.restapiexample.com/api/v1/employees'
      );
      setDoggoData (result.data);
      setIsLoading (false);
    };
    fetchData ();
  }, []);

  return (
    <div
      className="container"
      style={{paddingTop: '1em', paddingBottom: '1em'}}
    >
      <p>Axios Test</p>

      {isLoading && <h1>loading data ....</h1>}

      {/* {doggoData.data.map (doggo => (
        <DoggoList
          key={doggo.id}
          doggoName={doggo.name}
          doggoAge={doggo.age}
          doggoId={doggo.doggo_id.first + '...' + doggo.doggo_id.last}
          doggoDescription={doggo.description}
        />
        })} */}

        {doggoData.data.map (doggo => {
            <ul>
                <li>{doggo.employee_name}</li>
                <li>{doggo.employee_salary}</li>
                <li>{doggo.employee_age}</li>
            </ul>
        })}
    </div>
  );
}

export default AxiosTest;
